/*
 * Length vs length()
 * length variable vs length method
 */
package arrays;

public class Array11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] x=new int[5];
		String name="Jack";
		System.out.println("Length for variable "+x.length);
		System.out.println("length for Method "+name.length());
	}

}
